module.exports = "<clr-doc-wrapper [ng]=\"ng\" [ui]=\"ui\" [title]=\"title\" [newLayout]=\"newLayout\">\n    <article>\n\n        <h5 class=\"component-summary\" id=\"buttons-header\">Buttons allow an application to communicate action and direct user intent.</h5>\n\n        <h3>Three different types</h3>\n\n        <div class=\"row\">\n            <div class=\"col-sm-12 col-md-4\">\n                <div class=\"clrweb-DoxMedia\">\n                    <div class=\"clrweb-DoxMedia-block\">\n                        <div class=\"clrweb-DoxMedia-img\">\n                            <button class=\"btn btn-primary\">Solid Button</button>\n                        </div>\n                    </div>\n                    <div class=\"clrweb-DoxMedia-text\">\n                        <p>\n                            Solid buttons look heavy on purpose. They direct the users attention to the <b>primary action</b> the application is suggesting that the user take.\n                        </p>\n                    </div>\n                </div>\n            </div>\n\n            <div class=\"col-sm-12 col-md-4\">\n                <div class=\"clrweb-DoxMedia\">\n                    <div class=\"clrweb-DoxMedia-block\">\n                        <div class=\"clrweb-DoxMedia-img\">\n                            <button class=\"btn\">Outline Button</button>\n                        </div>\n                    </div>\n                    <div class=\"clrweb-DoxMedia-text\">\n                        <p>\n                            Outline buttons provide a lighter weight button style. They are used to indicate a <b>secondary action</b> that compliments a primary action or to reduce visual noise when there are many action of <b>equal</b> importance on the\n                            page.\n                        </p>\n                    </div>\n                </div>\n            </div>\n\n            <div class=\"col-sm-12 col-md-4\">\n                <div class=\"clrweb-DoxMedia\">\n                    <div class=\"clrweb-DoxMedia-block\">\n                        <div class=\"clrweb-DoxMedia-img\">\n                            <button class=\"btn btn-link\">Flat Button</button>\n                        </div>\n                    </div>\n                    <div class=\"clrweb-DoxMedia-text\">\n                        <p>\n                            Flat buttons are used in multiple scenarios. They are used as <b>tertiary buttons</b>. They can also be used inline because they are different from content in style and recognizable as buttons alongside content\n                        </p>\n                    </div>\n                </div>\n            </div>\n        </div>\n\n        <div class=\"clrweb-DoxVersusBox\">\n            <div class=\"clrweb-DoxVersusBox-pin\">\n                <clr-icon shape=\"pin\"></clr-icon>\n            </div>\n            <div class=\"clrweb-DoxVersusBox-items\">\n                <div class=\"clrweb-DoxVersusBox-itemWrapper\">\n                    <div class=\"clrweb-DoxVersusBox-item\">\n                        <p><button class=\"btn btn-link btn-sm\" style=\"padding-left: 0; margin: 0;\">FLAT BUTTON</button></p>\n                        <p>Use flat buttons when a user is expected to <b>take an action</b>.</p>\n                    </div>\n                </div>\n                <div class=\"clrweb-DoxVersusBox-vsWrapper\">\n                    <div class=\"clrweb-DoxVersusBox-vs\">vs</div>\n                </div>\n                <div class=\"clrweb-DoxVersusBox-itemWrapper\">\n                    <div class=\"clrweb-DoxVersusBox-item\">\n                        <p><a href=\"javascript://\">Link</a></p>\n                        <p>Use a link when a user is expected to be <b>taken to a different page</b>.</p>\n                    </div>\n                </div>\n            </div>\n        </div>\n\n        <h3 id=\"placement\">Placement</h3>\n        <p>There are two distinct patterns when it comes to the placement of a button.</p>\n\n        <div class=\"row\">\n            <div class=\"col-sm-12 col-md-6\">\n                <div class=\"clrweb-DoxMedia\">\n                    <div class=\"clrweb-DoxMedia-block\" style=\"height: 297px\">\n                        <div class=\"clrweb-DoxMedia-img\">\n                            <img src=\"assets/images/documentation/buttons/z_pattern.svg\" alt=\"Z pattern\" />\n                        </div>\n                    </div>\n                    <div class=\"clrweb-DoxMedia-text\">\n                        <h6>Z Pattern</h6>\n                        <p>\n                            The Z-pattern is a natural way for the user to go through content within a <b>constrained container</b> and when tasks are oriented from the top-left and ending with a <b>primary call to action on the right bottom side</b> of the\n                            container. This pattern is reversed for right to left languages.\n                        </p>\n                        <div class=\"clrweb-DoxBookmark hidden-md-up\">\n                            <div class=\"clrweb-DoxBookmark-bookmark\">\n                                <clr-icon shape=\"bookmark\"></clr-icon>\n                            </div>\n                            <p>\n                                Modals and Wizards follow the Z Pattern\n                            </p>\n                        </div>\n                    </div>\n                </div>\n            </div>\n\n            <div class=\"col-sm-12 col-md-6\">\n                <div class=\"clrweb-DoxMedia\">\n                    <div class=\"clrweb-DoxMedia-block\" style=\"height: 297px\">\n                        <div class=\"clrweb-DoxMedia-img\">\n                            <img src=\"assets/images/documentation/buttons/f_pattern.svg\" alt=\"F pattern\" />\n                        </div>\n                    </div>\n                    <div class=\"clrweb-DoxMedia-text\">\n                        <h6>F Pattern</h6>\n                        <p>\n                            The F-pattern is a natural way to go through content in an <b>unconstrained container</b>, such as a form on the page itself. The user will go through the content line-by-line, arriving at a call to action at the end.\n                        </p>\n                        <div class=\"clrweb-DoxBookmark hidden-md-up\">\n                            <div class=\"clrweb-DoxBookmark-bookmark\">\n                                <clr-icon shape=\"bookmark\"></clr-icon>\n                            </div>\n                            <p>Forms and Cards follow the F Pattern</p>\n                        </div>\n                    </div>\n                </div>\n            </div>\n        </div>\n\n        <div class=\"row\">\n            <div class=\"col-md-6 hidden-sm-down\">\n                <div class=\"clrweb-DoxBookmark hidden-sm-down\">\n                    <div class=\"clrweb-DoxBookmark-bookmark\">\n                        <clr-icon shape=\"bookmark\"></clr-icon>\n                    </div>\n                    <p>Modals and Wizards follow the Z Pattern</p>\n                </div>\n            </div>\n            <div class=\"col-md-6 hidden-sm-down\">\n                <div class=\"clrweb-DoxBookmark\">\n                    <div class=\"clrweb-DoxBookmark-bookmark\">\n                        <clr-icon shape=\"bookmark\"></clr-icon>\n                    </div>\n                    <p>Forms and Cards follow the F Pattern</p>\n                </div>\n            </div>\n        </div>\n\n        <h3 id=\"style\">Style</h3>\n\n        <p>Consistent button styles make it easier for a user to recognize areas to take action across an application.</p>\n\n        <h5 id=\"typography\">Typography</h5>\n\n        <p>The text inside of buttons is always <b>uppercase</b>. This indicates action by differentiating button text from links and other content on the page. Use descriptive language on buttons relating to the users intent.</p>\n\n        <div class=\"row\">\n            <div class=\"col-sm-12 col-md-6\">\n                <div class=\"clrweb-DoxMedia is-dont-block\">\n                    <div class=\"clrweb-DoxMedia-block\" style=\"height: 276px\">\n                        <div class=\"clrweb-DoxMedia-img\">\n                            <img src=\"assets/images/documentation/buttons/typography_dont.svg\" alt=\"Don't use generic language not related to the action'\" />\n                        </div>\n                    </div>\n                    <div class=\"clrweb-DoxMedia-text\">\n                        <h6 class=\"clrweb-DoxMedia-do-dont\">Don't</h6>\n                        <p>\n                            Use generic language not related to the action and not relating to the intent of the user.\n                        </p>\n                    </div>\n                </div>\n            </div>\n\n            <div class=\"col-sm-12 col-md-6\">\n                <div class=\"clrweb-DoxMedia is-do-block\">\n                    <div class=\"clrweb-DoxMedia-block\" style=\"height: 276px\">\n                        <div class=\"clrweb-DoxMedia-img\">\n                            <img src=\"assets/images/documentation/buttons/typography_do.svg\" alt=\"Use a call to action on buttons\" />\n                        </div>\n                    </div>\n                    <div class=\"clrweb-DoxMedia-text\">\n                        <h6 class=\"clrweb-DoxMedia-do-dont\">Do</h6>\n                        <p>\n                            Use a call to action on buttons.\n                        </p>\n                    </div>\n                </div>\n            </div>\n        </div>\n\n        <h5 id=\"visual-style\">Visual Style</h5>\n\n        <h6 id=\"border-radius\">Border Radius</h6>\n\n        <p>Clarity buttons have a border radius of 3px.</p>\n\n        <h6 id=\"size\">Size</h6>\n\n        <div class=\"row\">\n            <div class=\"col-md-6 col-sm-12\">\n                <p>Clarity offers two button sizes:</p>\n                <ul class=\"list\">\n                    <li>Default height of 36px</li>\n                    <li>Compact height of 24px</li>\n                </ul>\n\n                <p>Compact is used in content areas where smaller buttons are needed to de-emphasize calls to action. This is especially true when multiple actions of equal importance are available.</p>\n            </div>\n            <div class=\"col-md-6 col-sm-12\">\n                <img class=\"clrweb-Img clrweb-Img--popout\" src=\"assets/images/documentation/buttons/button_sizes.png\" alt=\"Use compact buttons in content areas\" />\n            </div>\n        </div>\n\n        <div class=\"row\">\n            <div class=\"col-md-6 col-sm-12\">\n                <h6 id=\"primary-color\">Primary Color</h6>\n                <p>A primary color provides consistency across an application. It trains the user to look for that color when trying to find an action. Clarity defaults to blue. This action blue can be found across all types of buttons, tabs, and other action-related\n                    components.\n                </p>\n            </div>\n            <div class=\"col-md-6 hidden-sm-down\">&nbsp;</div>\n            <div class=\"col-md-6 col-sm-12\">\n                <h6 class=\"action-based-color\">Action-based Color</h6>\n                <p>Different colors may be used based on the severity of an actions result. For example, using a red button when deleting files indicates high severity.</p>\n            </div>\n            <div class=\"col-md-6 col-sm-12\">\n                <img class=\"clrweb-Img\" src=\"assets/images/documentation/buttons/action_colors.png\" alt=\"Action colors can indicate severity\" />\n            </div>\n        </div>\n\n        <!--See [Letter Case and Text Legibility in Normal and Low Vision](http://www.ncbi.nlm.nih.gov/pmc/articles/PMC2016 - 2017788/).-->\n\n\n        <h3 id=\"examples\">Code &amp; Examples</h3>\n\n        <p>Clarity defines three button styles:</p>\n\n        <ul class=\"list\">\n            <li><strong>Solid.</strong> A solid background with light text. These buttons are prominent on the page.</li>\n            <li><strong>Outline.</strong> A transparent background with colored border and text. On hover, the button fills with color.</li>\n            <li><strong>Flat.</strong> Text in Action Blue, used to indicate an action.</li>\n        </ul>\n\n        <clr-buttons-demo-real-button class=\"clrweb-button-demo\"></clr-buttons-demo-real-button>\n\n        <h3 id=\"types\">Types</h3>\n\n        <clr-buttons-demo-primary-button class=\"clrweb-button-demo\"></clr-buttons-demo-primary-button>\n\n        <clr-buttons-demo-secondary-button class=\"clrweb-button-demo indent\"></clr-buttons-demo-secondary-button>\n\n        <clr-buttons-demo-tertiary-button class=\"clrweb-button-demo indent\"></clr-buttons-demo-tertiary-button>\n\n        <h3 id=\"states\">States</h3>\n\n        <clr-buttons-demo-button-states class=\"clrweb-button-demo\"></clr-buttons-demo-button-states>\n\n        <h3 id=\"sizes\">Sizes</h3>\n\n        <clr-buttons-demo-button-sizes class=\"clrweb-button-demo\"></clr-buttons-demo-button-sizes>\n\n        <h3 id=\"inverse\">Inverse</h3>\n\n        <clr-buttons-demo-inverse-button class=\"clrweb-button-demo\"></clr-buttons-demo-inverse-button>\n\n        <h3>Loading Buttons</h3>\n\n        <clr-buttons-demo-button-loading></clr-buttons-demo-button-loading>\n\n    </article>\n</clr-doc-wrapper>"

