module.exports = "<clr-doc-wrapper [ng]=\"ng\" [ui]=\"ui\" [title]=\"title\" [newLayout]=\"newLayout\">\n\n\n    <article><h5 class=\"component-summary no-margin\"\n                 id=\"the-clarity-color-palette-is-primarily-based-on-alignment-with-color-use-in-web-applications-and-support-for-accessibility\">\n        The Clarity color palette is aligned with color use in web applications and support for accessibility.</h5>\n\n        <h3 id=\"color-palette\">The Clarity Color Palette</h3>\n\n        <p>\n            The colors below constitute the expanded color palette for Clarity. Text colors displayed in light or dark\n            tints represent Clarity's recommended accessible pairing with the color.\n        </p>\n\n        <p>\n            The larger color swatches indicate colors that are part of the Clarity _base color palette_. You will find\n            these colors in use throughout Clarity's components and design recommendations.\n        </p>\n\n        <clr-color-palette></clr-color-palette>\n\n        <h3 id=\"text-contrast\">Text Contrast</h3>\n\n        <p>Claritys SASS library ships with color functions that can test background and text combinations against the\n            WCAG AA accessibility standard. This standard establishes a minimum contrast for users with a visual\n            impairment.</p>\n\n        <p>To use these functions, import the <code\n                class=\"clr-code\">[PATH_TO_CLARITY]/src/color/color.clarity.scss</code> file into a SCSS/SASS file in\n            your project.</p>\n\n        <p>The text color functions in Clarity perform a lookup against a customizable set of color contrasts in the\n            color palette. To get a text color, you would use the following SASS function:</p>\n\n        <h5 id=\"clr-gettextcolorbackground-typeoftext-fontweight-fontsize-coloroftext\">clr-getTextColor([background],\n            [typeOfText], [fontWeight], [fontSize], [colorOfText])</h5>\n\n        <h6 id=\"background\">background</h6>\n\n        <p>A hex color of the background the text will appear over. Defaults to white. Theoretically, it could handle\n            rgb() or hsl() values but that is untested. rgba() and color strings are likely not going to work.</p>\n\n        <h6 id=\"typeoftext\">typeOfText</h6>\n        <p><em>(Optional)</em> Defaults to text. Accepted types are:</p>\n\n        <ul class=\"list\">\n            <li><strong>text:</strong> Default darkness for text color.</li>\n            <li><strong>subtext:</strong> A text color 1 or 2 shades removed from text.</li>\n            <li><strong>hover-text:</strong> Text color for links.</li>\n            <li><strong>hover-text-hovered:</strong> Text color for links in a hovered state.</li>\n            <li><strong>hover-text-clicked:</strong> Text color for links in an active state.</li>\n            <li><strong>hover-text-active:</strong> An alias for the hover-text-clicked type above.</li>\n            <li><strong>lightest:</strong> If possible, the accessible color closest to white. Otherwise, the lightest\n                accessible color against the background.\n            </li>\n            <li><strong>darkest:</strong> If possible, the accessible color closest to black. Otherwise, the darkest\n                accessible color against the background.\n            </li>\n            <li><strong>black:</strong> Returns black if it is accessible against the background.</li>\n            <li><strong>white:</strong> Returns white if it is accessible against the background.</li>\n        </ul>\n\n        <h6 id=\"fontweight\">fontWeight</h6>\n        <p><em>(Optional)</em> Defaults to normal. Accepted types are: bold, thin, and normal.</p>\n\n        <h6 id=\"fontsize\">fontSize</h6>\n        <p><em>(Optional)</em> Defaults to normal. Accepted types are: big, small, and normal.</p>\n\n        <h6 id=\"coloroftext\">colorOfText</h6>\n        <p><em>(Optional)</em> Defaults to grays. Determines the family of colors that the text color will be pulled\n            from. Accepted types are:</p>\n\n        <ul class=\"list\">\n            <li><strong>grays:</strong> The neutral palette.</li>\n            <li><strong>neutrals:</strong> The neutral palette.</li>\n            <li><strong>blues:</strong> The less-saturated blues used for backgrounds (section blues).</li>\n            <li><strong>tinted-neutrals:</strong> An alias for blues above.</li>\n            <li><strong>action-blues:</strong> Saturated blue palette used for links and buttons.</li>\n            <li><strong>action-purples:</strong> Purple palette that may one day be used for links and buttons.</li>\n            <li><strong>purples:</strong> Purple palette that may one day be used for links and buttons.</li>\n            <li><strong>reds:</strong> Stoplight red color palette.</li>\n            <li><strong>greens:</strong> Stoplight green color palette.</li>\n            <li><strong>yellows:</strong> Stoplight yellow color palette with some oranges in the midtones and browns in\n                the darker shades.\n            </li>\n        </ul>\n\n        <p>All parameters are optional. And the color lookup is fairly robust. Worst case is it returns either a pure\n            white or pure black based off whether it is given a light or dark background.</p>\n\n        <h3 id=\"luminance-test\">Luminance Test</h3>\n\n        <p>The WCAG AA standard compares colors luminance and chromaticity to establish a contrast ratio between them.\n            The following set of tables demonstrates the accuracy of the SASS functions the Clarity team has built to\n            test contrast.</p>\n\n        <p>In the tables below, a hard-coded expected value is compared against a value generated by the Clarity color\n            contrast functions.</p>\n\n        <clr-color-demo-luminance></clr-color-demo-luminance>\n\n        <h3 class=\"hide-responsive\" id=\"contrast-test\">Contrast Test</h3>\n\n        <p class=\"hide-responsive\">The tables below demonstrate expected values for Claritys color contrast\n            utilities.</p>\n\n        <clr-color-demo-contrast class=\"hide-responsive\"></clr-color-demo-contrast>\n\n        <h3 id=\"guidelines\">Color Usage</h3>\n\n        <h4 id=\"base-colors\">Base Colors</h4>\n        <p>Colors within the Clarity palette are derivatives of the five base colors and are complementary in a\n            monochromatic, triad, or quadratic relationship:</p>\n\n        <ul class=\"list\">\n            <li>Neutral colors are for text and backgrounds. The default text color is #565656. The default background\n                color is #FAFAFA.\n            </li>\n            <li>Action colors are for clickable items, such as buttons and links. Action Blue, #007CBB, is reserved for\n                buttons and links.\n            </li>\n        </ul>\n\n        <h4 id=\"stoplight-colors-1\">Stoplight Colors</h4>\n\n        <p>The stoplight colors are for indicating error conditions, warnings, and successes. Significant colors\n            include:</p>\n\n        <ul class=\"list\">\n            <li>Stoplight Green, #318700, for positive actions.</li>\n            <li>Stoplight Red, #E62700, for warnings and errors.</li>\n        </ul>\n\n        <h4 id=\"highlight-colors-1\">Highlight Colors</h4>\n\n        <p>The highlight colors are intended for use in charts, highlighting search results, and badging. These colors\n            stand out against Claritys primary colors. Dont use highlight colors in large blocks.</p>\n    </article>\n\n</clr-doc-wrapper>"

