module.exports = "<!--\n  ~ Copyright (c) 2016 - 2017 VMware, Inc. All Rights Reserved.\n  ~ This software is released under MIT license.\n  ~ The full license information can be found in LICENSE in the root directory of this project.\n  -->\n\n<h2>Basic structure</h2>\n\n<p>\n    To use our Datagrid, you do not need to pass an array of data or a JSON configuration to a\n    single element. Instead, we leverage a pure declarative API, just like any other Angular\n    component. You write your HTML just as you would for a basic table, with a\n    <code class=\"clr-code\">*ngFor</code> (or <code class=\"clr-code\">*clrDgItems</code>, see\n    Smart iterator) on the rows to iterate over your\n    data.\n</p>\n\n<clr-datagrid>\n    <clr-dg-column>User ID</clr-dg-column>\n    <clr-dg-column>Name</clr-dg-column>\n    <clr-dg-column>Creation date</clr-dg-column>\n    <clr-dg-column>Favorite color</clr-dg-column>\n\n    <clr-dg-row *ngFor=\"let user of users\">\n        <clr-dg-cell>{{user.id}}</clr-dg-cell>\n        <clr-dg-cell>{{user.name}}</clr-dg-cell>\n        <clr-dg-cell>{{user.creation | date}}</clr-dg-cell>\n        <clr-dg-cell>{{user.color}}</clr-dg-cell>\n    </clr-dg-row>\n\n    <clr-dg-footer>{{users.length}} users</clr-dg-footer>\n</clr-datagrid>\n\n<clr-example [clrCode]=\"example\" clrLanguage=\"html\"></clr-example>\n"

