module.exports = "<!--\n  ~ Copyright (c) 2016 - 2017 VMware, Inc. All Rights Reserved.\n  ~ This software is released under MIT license.\n  ~ The full license information can be found in LICENSE in the root directory of this project.\n  -->\n<h2>Selection batch action</h2>\n\n<p>\n    You can allow batch actions to be performed on selected rows in selectable datagrids. You can make the action\n    choices contextual to the selection by showing certain actions only if the selection meets the criteria.\n    Add a <code class=\"clr-code\">clr-dg-action-bar</code> inside a <code class=\"clr-code\">clr-datagrid</code>.\n    The content inside of it will be projected when one or more items is selected. We recommend that that you use\n    a button bar with small buttons as in the example.\n</p>\n\n<p>\n    In the following example, we simply display the names of the selected users, but since we\n    have access to the full objects, we could perform any operation we want on them.\n</p>\n\n<div class=\"card card-block\">\n    <p class=\"card-text username-list\">\n        Users to be added to group:\n        <em *ngIf=\"toAdd.length == 0\">No user selected.</em>\n        <span class=\"username\" *ngFor=\"let user of toAdd\">{{user.name}}</span>\n    </p>\n\n    <p class=\"card-text username-list\">\n        User to be edited:\n        <em *ngIf=\"!toEdit\">No user selected.</em>\n        <span class=\"username\" *ngIf=\"toEdit\">{{toEdit.name}}</span>\n    </p>\n\n    <p class=\"card-text username-list\">\n        Users to be deleted:\n        <em *ngIf=\"toDelete.length == 0\">No user selected.</em>\n        <span class=\"username\" *ngFor=\"let user of toDelete\">{{user.name}}</span>\n    </p>\n</div>\n\n<clr-datagrid [(clrDgSelected)]=\"selected\">\n    <clr-dg-action-bar>\n        <div class=\"btn-group\">\n            <button type=\"button\" class=\"btn btn-sm btn-secondary\" (click)=\"onAdd()\">\n                <clr-icon shape=\"plus\"></clr-icon> Add to group</button>\n            <button type=\"button\" class=\"btn btn-sm btn-secondary\" (click)=\"onDelete()\" ><clr-icon shape=\"close\"></clr-icon> Delete</button>\n            <button type=\"button\" class=\"btn btn-sm btn-secondary\" (click)=\"onEdit()\" *ngIf=\"selected.length == 1\"><clr-icon shape=\"pencil\"></clr-icon> Edit</button>\n        </div>\n    </clr-dg-action-bar>\n\n    <clr-dg-column>User ID</clr-dg-column>\n    <clr-dg-column>Name</clr-dg-column>\n    <clr-dg-column>Creation date</clr-dg-column>\n    <clr-dg-column>Favorite color</clr-dg-column>\n\n    <clr-dg-row *clrDgItems=\"let user of users\" [clrDgItem]=\"user\">\n        <clr-dg-cell>{{user.id}}</clr-dg-cell>\n        <clr-dg-cell>{{user.name}}</clr-dg-cell>\n        <clr-dg-cell>{{user.creation | date}}</clr-dg-cell>\n        <clr-dg-cell>\n            <span class=\"color-square\" [style.backgroundColor]=\"user.color\"></span>\n        </clr-dg-cell>\n    </clr-dg-row>\n\n    <clr-dg-footer>{{users.length}} users</clr-dg-footer>\n</clr-datagrid>\n\n<clr-example [clrCode]=\"mainExample\" clrLanguage=\"html\"></clr-example>\n\n<div class=\"alert alert-warning\">\n    <div class=\"alert-item\">\n        <span class=\"alert-text\">\n            The button group is still under development. More variations of button group implementations will be\n            available in a future release.\n        </span>\n    </div>\n</div>\n"

