module.exports = "<clr-doc-wrapper [ng]=\"ng\" [ui]=\"ui\" [title]=\"title\" [newLayout]=\"newLayout\">\n    <article>\n        <h5 class=\"component-summary\"\n            id=\"datagrids-are-for-organizing-large-volumes-of-data-that-users-can-scan-compare-and-perform-actions-on\">\n            Datagrids are for organizing large volumes of data that users can scan, compare, and perform actions\n            on.</h5>\n\n        <clr-datagrid-basic-structure-demo class=\"clrweb-datagrid-first-demo\"></clr-datagrid-basic-structure-demo>\n\n        <clr-datagrid-custom-rendering-demo></clr-datagrid-custom-rendering-demo>\n\n        <clr-datagrid-smart-iterator-demo></clr-datagrid-smart-iterator-demo>\n\n        <clr-datagrid-binding-properties-demo></clr-datagrid-binding-properties-demo>\n\n        <clr-datagrid-sorting-demo></clr-datagrid-sorting-demo>\n\n        <clr-datagrid-filtering-demo></clr-datagrid-filtering-demo>\n\n        <clr-datagrid-string-filtering-demo></clr-datagrid-string-filtering-demo>\n\n        <clr-datagrid-pagination-demo></clr-datagrid-pagination-demo>\n\n        <clr-datagrid-selection-demo></clr-datagrid-selection-demo>\n\n        <clr-datagrid-selection-single-demo></clr-datagrid-selection-single-demo>\n\n        <clr-datagrid-batch-action-demo></clr-datagrid-batch-action-demo>\n\n        <clr-datagrid-single-action-demo></clr-datagrid-single-action-demo>\n\n        <clr-datagrid-server-driven-demo></clr-datagrid-server-driven-demo>\n\n        <clr-datagrid-placeholder-demo></clr-datagrid-placeholder-demo>\n\n        <clr-datagrid-expandable-rows-demo></clr-datagrid-expandable-rows-demo>\n\n        <clr-datagrid-full-demo></clr-datagrid-full-demo>\n\n        <h3 id=\"guidelines\">Usage</h3>\n\n        <h4 id=\"for-structured-content\">For Structured Content</h4>\n\n        <p>Datagrids work best for structured, homogeneous content, where each object has the same attributes. When\n            common attributes are directly aligned in columns, users can quickly scan and compare them.</p>\n\n        <p>For data sets with a blend of text, images, and data visualizations, or content with mixed formatting, <a\n                routerLink=\"/documentation/cards\">cards</a> offer a better layout.</p>\n\n        <h4 id=\"for-large-volumes-of-data\">For Large Volumes of Data</h4>\n\n        <p>A datagrid is well-suited for presenting large volumes of data that dont fit on one page. Users can filter\n            and sort the data according to preference.</p>\n\n        <p>For smaller amounts of data (10 to 20 lines), datagrids are a relatively heavy component. Use datagrids\n            if:</p>\n\n        <ul>\n            <li>The data set will grow</li>\n            <li>Users need search, filter, or batch operations</li>\n        </ul>\n\n        <p>For a smaller volume of data, use a <a routerLink=\"/documentation/tables\">table</a>. Tables are a\n            lighter-weight solution with a static view.</p>\n    </article>\n</clr-doc-wrapper>"

