module.exports = "<clr-doc-wrapper [ng]=\"ng\" [ui]=\"ui\" [title]=\"title\" [newLayout]=\"newLayout\">\n    <article>\n        <h5 class=\"component-summary\"\n            id=\"a-dropdown-menu-lists-actions-that-users-can-perform-within-an-application-or-on-a-selected-object\">A\n            dropdown menu lists actions that users can perform within an application or on a selected object.</h5>\n\n        <h6 id=\"dropdown\">.dropdown:</h6>\n\n        <p>This class is a wrapper class around the <code class=\"clr-code\">.dropdown-toggle</code> and the <code\n                class=\"clr-code\">.dropdown-menu</code>\n        </p>\n\n        <h6 id=\"dropdown-toggle\">.dropdown-toggle:</h6>\n\n        <p>Extend this class on a button, icon or text link clicking on which the dropdown menu will be activated</p>\n\n        <h6 id=\"dropdown-menu\">.dropdown-menu:</h6>\n\n        <p>A required wrapper intended to contain the dropdown menu. Items in the menu should extend the <code\n                class=\"clr-code\">.dropdown-header</code>\n            or <code class=\"clr-code\">.dropdown-item</code> class. <code class=\"clr-code\">.dropdown-divider</code> can\n            be on a block element used to\n            seperate item groups.\n            <code class=\"clr-code\">.active</code> class with <code class=\"clr-code\">.dropdown-item</code> adds a\n            different styling for selected elements.\n            Add the <code class=\"clr-code\">.disabled</code> class to dropdown items to style them as disabled.</p>\n\n        <h6 id=\"open\">.open:</h6>\n\n        <p>A class to open the dropdown menu. Must be applied with <code class=\"clr-code\">.dropdown</code></p>\n\n        <p>The following classes when extended along with <code class=\"clr-code\">.dropdown</code> will open the menu in\n            the respective\n            directions:</p>\n\n        <ul class=\"list\">\n            <li>.bottom-left</li>\n            <li>.bottom-right</li>\n            <li>.top-left</li>\n            <li>.top-right</li>\n            <li>.left-bottom</li>\n            <li>.left-top</li>\n            <li>.right-top</li>\n            <li>.right-bottom</li>\n        </ul>\n\n        <h4 id=\"examples\">Examples</h4>\n\n        <h6 id=\"default-dropdown-bottom-left\">1. Default dropdown (bottom-left):</h6>\n\n        <clr-dropdown-static-default-demo></clr-dropdown-static-default-demo>\n\n        <h6 id=\"bottom-right\">2. Bottom-right</h6>\n\n        <clr-dropdown-static-positioning-demo></clr-dropdown-static-positioning-demo>\n\n        <h6 id=\"clarity-icon-as-the-dropdown-toggle\">3. Clarity icon as the dropdown toggle</h6>\n\n        <clr-dropdown-static-icon-toggle-demo></clr-dropdown-static-icon-toggle-demo>\n\n        <h6 id=\"link-button-as-the-dropdown-toggle\">4. Link Button as the dropdown toggle</h6>\n\n        <clr-dropdown-static-buttonlink-toggle-demo></clr-dropdown-static-buttonlink-toggle-demo>\n\n        <h2 id=\"angular-component\">Angular Component</h2>\n\n        <h3 id=\"summary-of-options\">Summary of Options</h3>\n\n        <table class=\"table\">\n            <thead>\n            <tr>\n                <th class=\"left\">Input</th>\n                <th class=\"left hidden-xs-down\">Values</th>\n                <th class=\"left hidden-xs-down\">Default</th>\n                <th class=\"left\">Effect</th>\n            </tr>\n            </thead>\n            <tbody>\n            <tr>\n                <td class=\"left\">\n                    <b>clrMenuPosition</b>\n                    <div class=\"hidden-sm-up\">Values:<br/>Direction classnames</div>\n                    <div class=\"hidden-sm-up\">Default: \"bottom-left\"</div>\n                </td>\n                <td class=\"left hidden-xs-down\">\n                    CSS dropdown menu direction classnames.\n                </td>\n                <td class=\"left hidden-xs-down\">Bottom-left</td>\n                <td class=\"left\">Sets the direction in which the menu will open.</td>\n            </tr>\n            <tr>\n                <td class=\"left\">\n                    <b>clrCloseMenuOnItemClick</b>\n                    <div class=\"hidden-sm-up\">Type: Boolean</div>\n                    <div class=\"hidden-sm-up\">Default: true</div>\n                </td>\n                <td class=\"left hidden-xs-down\">Boolean</td>\n                <td class=\"left hidden-xs-down\">true</td>\n                <td class=\"left\">If true, the menu will close when a dropdown item is clicked</td>\n            </tr>\n            </tbody>\n        </table>\n\n        <h4 id=\"example\">Example</h4>\n\n        <h6 id=\"clrmenuposition-is-set-to-top-left-default-is-bottom-left\">1. clrMenuPosition is set to top-left.\n            Default is bottom-left</h6>\n\n        <clr-dropdown-angular-positioning-demo></clr-dropdown-angular-positioning-demo>\n\n        <h6 id=\"clrclosemenuonitemclick-is-set-to-false-default-is-true\">2. clrCloseMenuOnItemClick is set to false.\n            Default is true.</h6>\n\n        <clr-dropdown-angular-close-item-false-demo></clr-dropdown-angular-close-item-false-demo>\n\n        <h3 id=\"guidelines\">Usage</h3>\n\n        <p>Use a dropdown menu in a header or other area of the UI, such as a column within a datagrid, to present a set\n            of actions. Often, these actions navigate to a new location. For example, you might have a Settings dropdown\n            that changes context to provide\n            logout, account settings, and so on.</p>\n\n        <p>Dont confuse dropdowns with <a routerLink=\"/documentation/select-boxes\">select boxes</a>, which also present\n            a list of choices. Select boxes are for data input within forms whereas dropdowns are for navigating outside\n            of the existing context.</p>\n\n        <h4 id=\"behavior\">Behavior</h4>\n\n        <p>Users open a dropdown by clicking its toggle. By default, selecting a menu item or clicking outside the menu\n            dismisses the menu. You can change this behavior so that the menu remains open on item selection.</p>\n\n        <h4 id=\"placement\">Placement</h4>\n\n        <p>By default, a dropdown opens from the bottom of the toggle, along the left side. You can change the placement\n            by using one of the eight direction classes.</p>\n\n        <h4 id=\"menu-toggle\">Menu Toggle</h4>\n\n        <p>Clarity recommends that you use a button for the toggle. The button can contain either text or an icon.</p>\n\n        <h4 id=\"menu-items\">Menu Items</h4>\n\n        <p>Order menu items by usage, except for destructive actions, which belong at the bottom. Keep the text short\n            and concise. Long menu items are truncated from the end and an ellipsis added.</p>\n\n        <h4 id=\"disabled\">Disabled</h4>\n\n        <p>Disable a menu item if:</p>\n\n        <ul class=\"list\">\n            <li>It can apply in a different context.</li>\n            <li>The user doesnt have permissions for the action.</li>\n            <li>An appropriate object is not currently selected.</li>\n        </ul>\n    </article>\n</clr-doc-wrapper>"

