module.exports = "<clr-doc-wrapper [ng]=\"ng\" [ui]=\"ui\" [title]=\"title\" [newLayout]=\"newLayout\">\n    <article>\n        <h5 class=\"component-summary\" id=\"a-form-is-a-structured-layout-of-related-input-components\">A form is a\n            structured layout of related input components.</h5>\n\n        <p>A container, often a <code class=\"clr-code\">div</code> with a <code class=\"clr-code\">.form-group</code>\n            classname on it, wraps one or more <code class=\"clr-code\">label</code> and <code\n                    class=\"clr-code\">input</code> pairs.</p>\n\n        <h6 id=\"form-block\">.form-block</h6>\n\n        <p class=\"squish\">This is an optional wrapper around one or more .form-group elements (see below). The\n            .form-block element can hold a label element that serves as a title or header for the form-groups within\n            it.</p>\n\n        <h6 id=\"form-group\">.form-group</h6>\n\n        <p class=\"squish\">This is a wrapper intended to contain a label and one or more input, .select, .checkbox,\n            .radio, or other form fields.</p>\n\n        <h6 id=\"select\">.select</h6>\n\n        <p class=\"squish\">This is a required wrapper intended to contain a select element and its options. The wrapper\n            is necessary to apply the custom Clarity styles for select boxes.</p>\n\n        <h6 id=\"radio-checkbox\">.radio, .checkbox</h6>\n\n        <p class=\"squish\">This is a required wrapper intended to contain a radio button or a checkbox input followed by\n            a label element. The wrapper is necessary to handle the alignment and spacing of the elements within it.</p>\n\n        <h3 id=\"wrapper-elements\">Wrapper Elements</h3>\n\n        <p><code class=\"clr-code\">.form-block</code>, <code class=\"clr-code\">.form-group</code>, <code class=\"clr-code\">.select</code>,\n            <code class=\"clr-code\">.radio</code>, and <code class=\"clr-code\">.checkbox</code> wrappers can be placed on\n            any block HTML\n            element. The recommendation is for <code class=\"clr-code\">.form-block</code> classnames to be placed on\n            <code class=\"clr-code\">section</code> or <code class=\"clr-code\">fieldset</code> elements and for <code\n                    class=\"clr-code\">.form-group</code> classnames to be placed on <code class=\"clr-code\">div</code>\n            elements.</p>\n\n        <clr-forms-demo-fields></clr-forms-demo-fields>\n\n        <h3 id=\"compact-forms\">Compact Forms</h3>\n\n        <p>For forms inside of smaller containers like modals or wizards, the whitespace around form groups and form\n            blocks can be minimized by using the <code>.compact</code> classname.</p>\n\n        <clr-forms-compact-demo></clr-forms-compact-demo>\n\n        <h3 id=\"forms-in-grid\">Forms in Grid</h3>\n\n        <p>Forms can be used in a grid. Extend the <code class=\"clr-code\">.row</code> class on a <code class=\"clr-code\">.form-group</code>\n            and place the form fields in the grid column classes. To occupy 100% of the column width, extend the <code\n                    class=\"clr-code\">.form-control</code> class on the form field. Resize your browser to see how forms\n            in grids work.</p>\n\n        <clr-forms-demo-grid></clr-forms-demo-grid>\n\n        <h2 id=\"forms-using-angular-2\">Forms Using Angular</h2>\n\n        <p>Following are examples of using Clarity forms with the Template-Driven and Model-Driven/Reactive approaches\n            in Angular.</p>\n\n        <p>\n            <b>Note:</b> For more information see the Angular documentation on\n            <a href=\"https://angular.io/docs/ts/latest/guide/forms.html\">Template-Driven Forms</a> and\n            <a href=\"https://angular.io/docs/ts/latest/cookbook/dynamic-form.html\">Model-Driven/Reactive Forms</a>\n        </p>\n\n        <h3 id=\"example-1-template-driven-forms\">Example 1. Template-Driven Forms</h3>\n\n        <clr-template-driven-forms-demo></clr-template-driven-forms-demo>\n\n        <h3 id=\"example-2-model-driven-reactive-forms\">Example 2. Model-Driven/Reactive Forms</h3>\n\n        <clr-reactive-forms-demo></clr-reactive-forms-demo>\n\n        <h3 id=\"guidelines\">Usage</h3>\n\n        <p>Forms guide users through input in a structured, specific order. Forms are comprised of <a\n                routerLink=\"/documentation/typography\">text</a> and input components such as <a\n                routerLink=\"/documentation/checkboxes\">checkboxes</a>, <a routerLink=\"/documentation/dropdowns\">dropdowns</a>,\n            <a routerLink=\"/documentation/input-fields\">input fields</a>, <a routerLink=\"/documentation/radios\">radio\n                buttons</a>, and <a routerLink=\"/documentation/toggle-switches\">toggle switches</a>.</p>\n\n        <h4 id=\"minimize-scrolling\">Minimize Scrolling</h4>\n\n        <p>For a form that scrolls several pages, consider organizing the content by:</p>\n\n        <ul class=\"list\">\n            <li>Grouping related fields in a form block with a descriptive label.</li>\n            <li>Progressively revealing more complex or less frequently used data.</li>\n            <li>Dividing content into separate pages in a <a routerLink=\"/documentation/wizards\">wizard</a>.</li>\n        </ul>\n\n        <h4 id=\"labels\">Labels</h4>\n\n        <p>Labels appear to the left of a component, moving above the component when the user resizes the window to\n            smaller dimensions.</p>\n\n        <p>Labels use sentence case, and label headers use title case, with no ending punctuation.</p>\n\n        <h4 id=\"placeholder-text\">Placeholder Text</h4>\n\n        <p>Located inside a field, placeholder text can help clarify expected input. Placeholder text disappears when\n            the user types in the field.</p>\n\n        <p>Tip: Use the label to show what information goes in the field and placeholder text as a hint, description, or\n            example format:</p>\n\n        <p>Label: Airport\n            <br/> Placeholder text: SFO, SJO</p>\n\n        <p>Placeholder text can replace labels only in simple forms with a few easily-understood fields, see the <a\n                routerLink=\"/documentation/login\">login page</a>.</p>\n\n        <h4 id=\"disabled-fields\">Disabled Fields</h4>\n\n        <p>Show a disabled field only if the user can take a reasonable action to enable the component. When disabling a\n            component, also disable all associated elements, such as the component label and explanatory text.</p>\n\n        <h4 id=\"button-placement\">Button Placement</h4>\n\n        <p>Button placement depends on form type and where it appears in the UI. See <a\n                routerLink=\"/documentation/buttons\">buttons</a> for guidelines.</p>\n\n        <h4 id=\"validation\">Validation</h4>\n\n        <p>For information on validation, see <a routerLink=\"/documentation/input-fields\">input fields</a>.</p>\n\n        <h4 id=\"focus-and-navigation\">Focus and Navigation</h4>\n\n        <p>Provide auto focus in the first field by default. Users can then navigate through the form in a logical\n            sequence.</p>\n    </article>\n</clr-doc-wrapper>"

