module.exports = "<clr-doc-wrapper [ng]=\"ng\" [ui]=\"ui\" [title]=\"title\" [newLayout]=\"newLayout\">\n    <article>\n        <h5 class=\"component-summary\" id=\"clarity-svg-based-icons\">Clarity presents pixel-perfect and scalable SVG-based\n            icons. This new icon system gives you complete control over the color, orientation, and size. Additionally,\n            you can access and customize any SVG graphic element inside the icon through standard\n            CSS.\n        </h5>\n\n        <clr-icon-selection-demo></clr-icon-selection-demo>\n\n        <h5 id=\"color-options\">Color options</h5>\n        <clr-icon-colors-demo></clr-icon-colors-demo>\n\n        <h5 id=\"inverse-color-option\">Inverse color option</h5>\n        <clr-icon-inverse-colors-demo></clr-icon-inverse-colors-demo>\n\n        <h5 id=\"setting-the-icon-size\">Setting the icon size</h5>\n        <clr-icon-size-demo></clr-icon-size-demo>\n\n        <h5 id=\"orientation-options\">Orientation options</h5>\n        <clr-icon-orientation-demo></clr-icon-orientation-demo>\n\n        <h5 id=\"icon-variants\">Icon Variants</h5>\n\n        <p>Clarity Icons comes with variations of each icon where applicable. Variations include:</p>\n\n        <ul class=\"list\">\n            <li><b>Badged icons</b> have a small dot in the top right corner</li>\n            <li><b>Alerted icons</b> have a triangle in the top right corner</li>\n            <li><b>Solid icons</b> are filled in as opposed to the outlined look of the default icons</li>\n            <li><b>Combinations</b> such as <i>solid + badged</i> and <i>alerted + badged</i></li>\n        </ul>\n\n        <p>\n            <clr-icon shape=\"user\" size=\"36\"></clr-icon>\n            <clr-icon shape=\"user\" class=\"has-alert\" size=\"36\"></clr-icon>\n            <clr-icon shape=\"user\" class=\"has-badge\" size=\"36\"></clr-icon>\n            <clr-icon shape=\"user\" class=\"is-solid\" size=\"36\"></clr-icon>\n            <clr-icon shape=\"user\" class=\"is-solid has-alert\" size=\"36\"></clr-icon>\n            <clr-icon shape=\"user\" class=\"is-solid has-badge\" size=\"36\"></clr-icon>\n            <clr-icon shape=\"user\" class=\"is-solid has-badge--success\" size=\"36\"></clr-icon>\n        </p>\n\n        <p>Displaying an icon variant only requires adding a CSS class to your <code class=\"clr-code\">clr-icon</code>\n            element. Applicable classes are listed below.</p>\n\n        <div class=\"row\">\n            <div class=\"col-xs-12\">\n                <table class=\"table\">\n                    <thead>\n                    <tr>\n                        <th class=\"left\">Class name</th>\n                        <th class=\"left\">What it does</th>\n                    </tr>\n                    </thead>\n                    <tbody>\n                    <tr>\n                        <td class=\"left\"><code class=\"clr-code\">.is-solid</code></td>\n                        <td class=\"left\">Replaces the default outlined style of the icon with a filled-in solid version\n                            for icons that have a solid version.\n                        </td>\n                    </tr>\n                    <tr>\n                        <td class=\"left\"><code class=\"clr-code\">.has-alert</code></td>\n                        <td class=\"left\">Causes a small yellow triangle to appear in the top right corner of an icon\n                            that supports it.\n                        </td>\n                    </tr>\n                    <tr>\n                        <td class=\"left\"><code class=\"clr-code\">.has-badge</code></td>\n                        <td class=\"left\">Causes a small dot to appear in the top right corner of an icon that supports\n                            badging. By default, this dot is red.\n                        </td>\n                    </tr>\n                    <tr>\n                        <td class=\"left\"><code class=\"clr-code\">.has-badge--success</code></td>\n                        <td class=\"left\">Causes a small green dot to appear in the top right corner of an icon that\n                            supports badging.\n                        </td>\n                    </tr>\n                    <tr>\n                        <td class=\"left\"><code class=\"clr-code\">.has-badge--error</code></td>\n                        <td class=\"left\">Causes a small red dot to appear in the top right corner of an icon that\n                            supports badging.\n                        </td>\n                    </tr>\n                    <tr>\n                        <td class=\"left\"><code class=\"clr-code\">.has-badge--info</code></td>\n                        <td class=\"left\">Causes a small blue dot to appear in the top right corner of an icon that\n                            supports badging.\n                        </td>\n                    </tr>\n                    </tbody>\n                </table>\n            </div>\n        </div>\n\n        <pre><code clr-code-highlight=\"language-html\">\n&lt;clr-icon shape=&quot;user&quot; size=&quot;36&quot;&gt;&lt;/clr-icon&gt;\n&lt;clr-icon shape=&quot;user&quot; class=&quot;has-alert&quot; size=&quot;36&quot;&gt;&lt;/clr-icon&gt;\n&lt;clr-icon shape=&quot;user&quot; class=&quot;has-badge&quot; size=&quot;36&quot;&gt;&lt;/clr-icon&gt;\n&lt;clr-icon shape=&quot;user&quot; class=&quot;is-solid&quot; size=&quot;36&quot;&gt;&lt;/clr-icon&gt;\n&lt;clr-icon shape=&quot;user&quot; class=&quot;is-solid has-alert&quot; size=&quot;36&quot;&gt;&lt;/clr-icon&gt;\n&lt;clr-icon shape=&quot;user&quot; class=&quot;is-solid has-badge&quot; size=&quot;36&quot;&gt;&lt;/clr-icon&gt;\n&lt;clr-icon shape=&quot;user&quot; class=&quot;is-solid has-badge--success&quot; size=&quot;36&quot;&gt;&lt;/clr-icon&gt;\n</code></pre>\n\n\n        <h3 id=\"guidelines\">Usage</h3>\n\n        <h6 id=\"predefined-color-classes\">Predefined color classes:</h6>\n\n        <div class=\"row\">\n            <div class=\"col-xs-12\">\n                <table class=\"table table-vertical\">\n                    <tbody>\n                    <tr>\n                        <th>Color options</th>\n                        <td class=\"hidden-xs-down\">Class</td>\n                        <td>Color code</td>\n                        <td>Preview</td>\n                    </tr>\n                    <tr>\n                        <th>\n                            Highlight\n                            <div class=\"hidden-sm-up\"><code class=\"clr-code\">.is-highlight</code></div>\n                        </th>\n                        <td class=\"hidden-xs-down\"><code class=\"clr-code\">.is-highlight</code></td>\n                        <td>#007CBB</td>\n                        <td>\n                            <clr-icon shape=\"info\" size=\"24\" class=\"is-highlight\"></clr-icon>\n                        </td>\n                    </tr>\n                    <tr>\n                        <th>\n                            Danger\n                            <div class=\"hidden-sm-up\"><code class=\"clr-code\">.is-danger</code></div>\n                        </th>\n                        <td class=\"hidden-xs-down\"><code class=\"clr-code\">.is-danger</code></td>\n                        <td>#E62700</td>\n                        <td>\n                            <clr-icon shape=\"info\" size=\"24\" class=\"is-danger\"></clr-icon>\n                        </td>\n                    </tr>\n                    <tr>\n                        <th>\n                            Warning\n                            <div class=\"hidden-sm-up\"><code class=\"clr-code\">.is-warning</code></div>\n                        </th>\n                        <td class=\"hidden-xs-down\"><code class=\"clr-code\">.is-warning</code></td>\n                        <td>#FAC400</td>\n                        <td>\n                            <clr-icon shape=\"info\" size=\"24\" class=\"is-warning\"></clr-icon>\n                        </td>\n                    </tr>\n                    <tr>\n                        <th>\n                            Success\n                            <div class=\"hidden-sm-up\"><code class=\"clr-code\">.is-success</code></div>\n                        </th>\n                        <td class=\"hidden-xs-down\"><code class=\"clr-code\">.is-success</code></td>\n                        <td>#318700</td>\n                        <td>\n                            <clr-icon shape=\"info\" size=\"24\" class=\"is-success\"></clr-icon>\n                        </td>\n                    </tr>\n                    <tr>\n                        <th>\n                            Info\n                            <div class=\"hidden-sm-up\"><code class=\"clr-code\">.is-info</code></div>\n                        </th>\n                        <td class=\"hidden-xs-down\"><code class=\"clr-code\">.is-info</code></td>\n                        <td>#007CBB</td>\n                        <td>\n                            <clr-icon shape=\"info\" size=\"24\" class=\"is-info\"></clr-icon>\n                        </td>\n                    </tr>\n                    <tr>\n                        <th>\n                            Inverse\n                            <div class=\"hidden-sm-up\"><code class=\"clr-code\">.is-inverse</code></div>\n                        </th>\n                        <td class=\"hidden-xs-down\"><code class=\"clr-code\">.is-inverse</code></td>\n                        <td>#FFFFFF</td>\n                        <td style=\"background-color:#414957\">\n                            <clr-icon shape=\"info\" size=\"24\" class=\"is-inverse\"></clr-icon>\n                        </td>\n                    </tr>\n                    </tbody>\n                </table>\n            </div>\n        </div>\n\n        <h6 id=\"icon-orientations\">Icon orientations:</h6>\n\n        <p>When you set the icon orientation either in the <code class=\"clr-code\">shape</code> or <code\n                class=\"clr-code\">dir</code> attribute of the <code class=\"clr-code\">clr-icon</code>, it rotates its\n            inside SVG graphic element to your specified direction.</p>\n\n        <div class=\"row\">\n            <div class=\"col-xs-12\">\n                <table class=\"table\">\n                    <thead>\n                    <tr>\n                        <th class=\"left\">Orientation options</th>\n                        <th class=\"left\">up</th>\n                        <th class=\"left\">right</th>\n                        <th class=\"left\">down</th>\n                        <th class=\"left\">left</th>\n                    </tr>\n                    </thead>\n                    <tbody>\n                    <tr>\n                        <td class=\"left\">Rotation</td>\n                        <td class=\"left\">0</td>\n                        <td class=\"left\">90</td>\n                        <td class=\"left\">180</td>\n                        <td class=\"left\">270</td>\n                    </tr>\n                    <tr>\n                        <td class=\"left\">Preview</td>\n                        <td class=\"left\">\n                            <clr-icon shape=\"caret up\" size=\"24\"></clr-icon>\n                        </td>\n                        <td class=\"left\">\n                            <clr-icon shape=\"caret right\" size=\"24\"></clr-icon>\n                        </td>\n                        <td class=\"left\">\n                            <clr-icon shape=\"caret down\" size=\"24\"></clr-icon>\n                        </td>\n                        <td class=\"left\">\n                            <clr-icon shape=\"caret left\" size=\"24\"></clr-icon>\n                        </td>\n                    </tr>\n                    </tbody>\n                </table>\n            </div>\n        </div>\n\n        <h6 id=\"manipulate-any-svg-graphic-element-inside-the-icon\">Manipulate any SVG graphic element inside the icon\n            with CSS</h6>\n\n        <p>\n            After adding <code class=\"clr-code\">clr-icon</code> in your HTML, view it using a web inspection tool. You\n            will find that SVG elements are injected inside the <code class=\"clr-code\">clr-icon</code> tag that are\n            responsible for drawing the icon.\n        </p>\n\n        <p>\n            You can individually select any of these SVG graphic elements and stylize them through CSS. For easier\n            access to the individual graphic parts of the icon, each piece of the glyph has a unique number identifier.\n            For example,\n            <code class=\"clr-code\">.clr-i-outline-path-3</code> targets the third path in the outlined version of an\n            icon.\n        </p>\n\n        <p>\n            There are also a couple of common CSS classes that can help you target common elements.\n            <code class=\"clr-code\">.clr-i-badge</code> targets the round dot in badged icons. Likewise, <code\n                class=\"clr-code\">.clr-i-alert</code> targets the yellow triangle in alerted icons. Both of these classes\n            work across solid and outlined icons.\n        </p>\n\n        <h3 id=\"clarity-icons-api\">Clarity Icons API</h3>\n\n        <p>\n            Clarity Icons features a namespaced core of functionality that is publicly accessible off of the browser's\n            <code class=\"clr-code\">window</code> object. This \"API\" is available at\n            <code class=\"clr-code\">window.ClarityIcons</code> and provides two useful pieces of functionality.\n        </p>\n\n        <h5>Adding custom icons to ClarityIcons</h5>\n        <p>\n            The ClarityIcons API enables you to add your own icons to the publically available ClarityIcons\n            architecture. Use the following call to add your icon to our library in your application:\n        </p>\n        <pre><code clr-code-highlight=\"language-typescript\">\nClarityIcons.add(&#123;\"shapeNameGoesHere\": &quot;&lt;svg ... &gt;[your SVG code goes here]&lt;/svg&gt;&quot;&#125;);\n</code></pre>\n        <p>\n            This API method will assign your SVG markup to the named shape it is sent. The icon can then be retrieved\n            like in your application like any other icon in the ClarityIcons library.\n        </p>\n        <pre><code clr-code-highlight=\"language-html\">\n&lt;clr-icon shape=&quot;shapeNameGoesHere&quot;&gt;&lt;/clr-icon&gt;\n</code></pre>\n\n        <h5>Creating custom aliases for ClarityIcons</h5>\n        <p>\n            The Clarity Icons API can create aliases for the icons in your application with a single API call:\n        </p>\n        <pre><code clr-code-highlight=\"language-typescript\">\nClarityIcons.alias(&#123;\"bell\": [\"alarm\", \"oh-noehz\"]&#125;);\n</code></pre>\n        <p>\n            The above method call will assign \"alarm\" and \"oh-noehz\" names to the existing \"bell\" icon shape. Now you\n            can use the \"bell\" icon with any of the new names you have assigned it.\n        </p>\n        <pre><code clr-code-highlight=\"language-html\">\n&lt;clr-icon shape=&quot;bell&quot;&gt;&lt;/clr-icon&gt;\n&lt;clr-icon shape=&quot;alarm&quot;&gt;&lt;/clr-icon&gt;\n&lt;clr-icon shape=&quot;oh-noehz&quot;&gt;&lt;/clr-icon&gt;\n</code></pre>\n\n    </article>\n</clr-doc-wrapper>"

