module.exports = "<clr-doc-wrapper [ng]=\"ng\" [ui]=\"ui\" [title]=\"title\" [newLayout]=\"newLayout\">\n    <article>\n        <h5 class=\"component-summary\" id=\"clarity-has-a-single-line-input-field-and-a-multiline-text-area\">Clarity has a\n            single-line input field and a multiline text area.</h5>\n\n        <p>Input fields are composed of a label followed by an <code class=\"clr-code\">input</code> or <code\n                class=\"clr-code\">textarea</code> wrapped in a block element with the <code\n                class=\"clr-code\">.form-group</code> classname applied to it.</p>\n\n        <clr-input-fields-types-demo></clr-input-fields-types-demo>\n\n        <h4 id=\"form-validation\">Form Validation</h4>\n\n        <p>You can use validation styling for input fields by wrapping the input tag in a container with the <code\n                class=\"clr-code\">.tooltip</code> class along with the <code class=\"clr-code\">.tooltip-validation</code>\n            class. Use the <code class=\"clr-code\">.invalid</code> class on the <code class=\"clr-code\">.tooltip-validation</code>\n            container to toggle the validation styling. Place the <code class=\"clr-code\">.tooltip-content</code> <b>after</b>\n            the <code class=\"clr-code\">input</code> tag.</p>\n\n        <p>You can set the direction of the tooltip using these classes:</p>\n\n        <ul class=\"list\">\n            <li>.tooltip-top-right</li>\n            <li>.tooltip-top-left</li>\n            <li>.tooltip-bottom-right</li>\n            <li>.tooltip-bottom-left</li>\n            <li>.tooltip-right</li>\n            <li>.tooltip-left</li>\n        </ul>\n\n        <p>You can set the size of the tooltips using these classes:</p>\n\n        <ul>\n            <li>.tooltip-xs</li>\n            <li>.tooltip-sm</li>\n            <li>.tooltip-md</li>\n            <li>.tooltip-lg</li>\n        </ul>\n\n        <h4 id=\"example\">Example</h4>\n\n        <clr-forms-demo-validation></clr-forms-demo-validation>\n\n        <h3 id=\"guidelines\">Usage</h3>\n\n        <h4 id=\"labels\">Labels</h4>\n\n        <p>Input fields require a brief label to indicate what information belongs in the field. The label appears to\n            the left of the input field and moves above it when the app is resized smaller.</p>\n\n        <ul class=\"list\">\n            <li>Ensure that the label wording is clear.</li>\n            <li>Keep the text to a single line.</li>\n            <li>Use sentence caps without final punctuation.</li>\n        </ul>\n\n        <h4 id=\"placeholder-text\">Placeholder Text</h4>\n\n        <p>Located inside a field, placeholder text can help clarify expected input. Placeholder text disappears when\n            the user types in the field.</p>\n\n        <p>Tip: Use the label to show what information goes in the field and placeholder text as a hint, description, or\n            example format:</p>\n\n        <p>Label: Airport\n            <br/> Placeholder text: SFO, SJO</p>\n\n        <p>Placeholder text can replace labels only in simple forms with a few easily-understood fields, see the <a\n                routerLink=\"/documentation/login\">login page</a>.</p>\n\n        <p>Placeholder text is not required for every input field.</p>\n\n        <h4 id=\"size\">Size</h4>\n\n        <p>For the best user experience, consider localization and keep in mind that word length varies among\n            languages.</p>\n\n        <h4 id=\"multiple-input-fields\">Multiple Input Fields</h4>\n\n        <p>A complex form might have multiple input fields, stacked vertically. Space the input fields evenly, clearly\n            associating labels with the corresponding input fields.</p>\n\n        <h4 id=\"validation\">Validation</h4>\n\n        <p>Avoid overlaying the validation tooltip on the data is being validated. By default, the position of the\n            tooltip is to the top-right of the error icon, pointing to its center. Other positions to consider are:</p>\n\n        <ul class=\"list\">\n            <li>Top left</li>\n            <li>Bottom right</li>\n            <li>Bottom left</li>\n            <li>Side left</li>\n            <li>Side right</li>\n        </ul>\n\n        <p>Base the width of the tooltip on the message text. Choices are 72 px, 120 px, 240 px, and 360 px. The default\n            is 240 px.</p>\n\n        <p>Make the message text short, but informative. For example, The username already exists. Enter a new name.\n            Try to limit the text to one line.</p>\n\n        <h4 id=\"multiline-text-area\">Multiline Text Area</h4>\n\n        <p>Use a multiline text area when a user must enter a long string. Content wraps when the cursor reaches the\n            right edge and scrolls when it reaches the lower edge.</p>\n    </article>\n</clr-doc-wrapper>"

