module.exports = "<clr-doc-wrapper [ng]=\"ng\" [ui]=\"ui\" [title]=\"title\" [newLayout]=\"newLayout\">\n    <article>\n\n        <h5 class=\"component-summary\" id=\"labels-header\">Labels show concise metadata in a compact format.</h5>\n\n        <div class=\"clr-demo-container\">\n            <div class=\"clr-demo-container__content\">\n                <span class=\"label label-blue\">john@example.com</span>\n                <span class=\"label label-blue\">james@example.com</span>\n            </div>\n        </div>\n\n        <h3>Style</h3>\n        <p>Labels are visually styled to differentiate them from buttons.</p>\n        <div class=\"row\">\n            <div class=\"col-xs-12 col-md-5\">\n                <h4>Overall Style</h4>\n                <p>\n                    The distinctive visual style of labels deliberately deviates from buttons. This prevents users from\n                    confusing labels with buttons and allows labels to co-exist with other components without competing\n                    for\n                    a user's attention with primary and secondary buttons on the screen.\n                </p>\n            </div>\n            <div class=\"col-xs-12 col-md-6 offset-md-1\">\n                <div class=\"clrweb-DoxMedia has-h4-margin\">\n                    <div class=\"clr-demo-container\">\n                        <span class=\"label label-purple\">Fruit</span>\n                        <span class=\"label label-purple\">Meat</span>\n                        <span class=\"label label-purple\">Drink</span>\n                        <span class=\"label label-purple\">Vegetable</span>\n                    </div>\n                </div>\n            </div>\n        </div>\n        <div class=\"row\">\n            <div class=\"col-xs-12 col-md-5\">\n                <h4>Color</h4>\n                <p>\n                    The Clarity color palette and the colors you are using throughout your application should guide\n                    which\n                    colors you choose for your labels. We recommend reserving stoplight colors (red, yellow, and green)\n                    to\n                    display state or status.\n                </p>\n                <p>\n                    If the intent is to use colors as a way to have groups of labels be visually distinct from one\n                    another,\n                    keep in mind that there may be accessibility issues around using color as your sole differentiator.\n                </p>\n                <p>\n                    Avoid using too many colors within the same context, displaying too many colors may distract the\n                    user\n                    from the core of your application and the information it presents.\n                </p>\n            </div>\n            <div class=\"col-xs-12 col-md-6 offset-md-1\">\n                <div class=\"clrweb-DoxMedia has-h4-margin\">\n                    <div class=\"clrweb-DoxMedia-block\">\n                        <div class=\"clrweb-DoxMedia-img is-left-aligned\">\n                            <img src=\"assets/images/documentation/labels/labels_color.svg\" alt=\"\">\n                        </div>\n                    </div>\n                </div>\n                <p>\n                    Status colors are generally reserved to display state or status.\n                </p>\n            </div>\n        </div>\n\n        <h3>Typography</h3>\n        <div class=\"row\">\n            <div class=\"col-xs-12 col-md-5\">\n                <h5>Capitalization</h5>\n                <p>\n                    To differentiate from buttons, it is recommended that you avoid using all caps for labels. Using all\n                    caps might make the user think the label is a button and conflates the use case for labels with\n                    actions\n                    and buttons.\n                </p>\n            </div>\n            <div class=\"col-xs-12 col-md-6 offset-md-1\">\n                <div class=\"clrweb-DoxMedia has-h4-margin\">\n                    <div class=\"clrweb-DoxMedia is-dont-block\">\n                        <div class=\"clr-demo-container\">\n                            <span class=\"label label-purple\">LONDON (LOCATION)</span>\n                            <span class=\"label label-purple\">NABLUS (LOCATION)</span>\n                        </div>\n                        <div class=\"clrweb-DoxMedia-text\">\n                            <h6 class=\"clrweb-DoxMedia-do-dont\">Don't</h6>\n                            <p>\n                                Use all caps in labels\n                            </p>\n                        </div>\n                    </div>\n                </div>\n            </div>\n        </div>\n        <div class=\"row\">\n            <div class=\"col-xs-12 col-md-5\">\n                <h5>Multiline Text</h5>\n                <p>\n                    Keep labels to one line of concise text. The use case for labels is to showcase information in a\n                    compact\n                    format.\n                </p>\n            </div>\n            <div class=\"col-xs-12 col-md-6 offset-md-1\">\n                <div class=\"clrweb-DoxMedia has-h4-margin\">\n                    <div class=\"clrweb-DoxMedia is-dont-block\">\n                        <div class=\"clr-demo-container\">\n                            <span style=\"padding: 15px; text-align: center\" class=\"label label-purple\">LONDON <br>(LOCATION)</span>\n                            <span style=\"padding: 15px; text-align: center\" class=\"label label-purple\">NABLUS <br>(LOCATION)</span>\n                        </div>\n                        <div class=\"clrweb-DoxMedia-text\">\n                            <h6 class=\"clrweb-DoxMedia-do-dont\">Don't</h6>\n                            <p>\n                                Use multiple lines of text within a single label.\n                            </p>\n                        </div>\n                    </div>\n                </div>\n            </div>\n        </div>\n        <div class=\"row\">\n            <div class=\"col-xs-12 col-md-5\">\n                <h5>Additional Metadata</h5>\n                <p>\n                    Describe additional information or metadata in parenthesis if necssary.\n                </p>\n            </div>\n            <div class=\"col-xs-12 col-md-6 offset-md-1\">\n                <div class=\"clrweb-DoxMedia has-h4-margin\">\n                    <div class=\"clrweb-DoxMedia is-do-block\">\n                        <div class=\"clr-demo-container\">\n                            <span class=\"label label-orange\">London (Location)</span>\n                            <span class=\"label label-orange\">Nablus (Location)</span>\n                        </div>\n                        <div class=\"clrweb-DoxMedia-text\">\n                            <h6 class=\"clrweb-DoxMedia-do-dont\">Do</h6>\n                            <p>\n                                Use parenthesis for additional metadata displayed in the same label.\n                            </p>\n                        </div>\n                    </div>\n                </div>\n            </div>\n        </div>\n\n        <h3>Behavior</h3>\n        <div class=\"row\">\n            <div class=\"col-xs-12 col-md-5\">\n                <h5>Clicking Labels</h5>\n                <p>\n                    Labels may be clickable. In this case, clicking on a label should perform an action related to that\n                    label. Clicking on a location label used as a tag, for example, could serve to filter the results in\n                    a\n                    nearby list by that location. Clicking a label could also display more information about the\n                    metadata\n                    described by that label.\n                </p>\n            </div>\n            <div class=\"col-xs-12 col-md-6 offset-md-1\">\n                <div class=\"clrweb-DoxMedia has-h4-margin\">\n                    <div class=\"clr-demo-container\">\n                        <a href=\"javascript://\" class=\"label label-purple clickable\">\n                            Chocolate\n                        </a>\n                        <a href=\"javascript://\" class=\"label label-purple clickable\">\n                            Vanilla\n                        </a>\n                        <a href=\"javascript://\" class=\"label label-purple clickable\">\n                            Mixed\n                        </a>\n                    </div>\n                </div>\n            </div>\n        </div>\n        <div class=\"row\">\n            <div class=\"col-xs-12 col-md-5\">\n                <h5>Dismissing Labels</h5>\n                <p>\n                    A label can be dismissed. Use a close icon at the right-most side of a label to dismiss it.\n                </p>\n            </div>\n            <div class=\"col-xs-12 col-md-6 offset-md-1\">\n                <div class=\"clrweb-DoxMedia has-h4-margin\">\n                    <div class=\"clr-demo-container\">\n                        <!--<div [style.visibility]=\"(numberOfUnreadAlerts == 0) ? 'hidden' : 'visible' \">-->\n                        <!--COUNTER: {{numberOfUnreadAlerts}}-->\n                        <!--</div>-->\n                        <a\n                                *ngIf=\"!hideJames\"\n                                (click)=\"hideJames = true\"\n                                href=\"javascript://\"\n                                class=\"label label-blue\">\n                            james@test.com\n                            <clr-icon shape=\"close\"></clr-icon>\n                        </a>\n                        <a\n                                *ngIf=\"!hideJimmy\"\n                                (click)=\"hideJimmy = true\"\n                                href=\"javascript://\"\n                                class=\"label label-blue\">\n                            jimmy@test.com\n                            <clr-icon shape=\"close\"></clr-icon>\n                        </a>\n                    </div>\n                </div>\n            </div>\n        </div>\n        <div class=\"row\">\n            <div class=\"col-xs-12 col-md-5\">\n                <h5>Labels and Badges</h5>\n                <p>\n                    Labels and badges can be used together to show a count relating to the metadata displayed in the\n                    label.\n                </p>\n            </div>\n            <div class=\"col-xs-12 col-md-6 offset-md-1\">\n                <div class=\"clrweb-DoxMedia has-h4-margin\">\n                    <div class=\"clr-demo-container\">\n                    <span class=\"label label-light-blue\">\n                        Production\n                        <span class=\"badge badge-light-blue\">12</span>\n                    </span>\n                        <span class=\"label label-light-blue\">\n                        Dev/Test\n                        <span class=\"badge badge-light-blue\">99+</span>\n                    </span>\n                    </div>\n                </div>\n            </div>\n        </div>\n        <div class=\"row\">\n            <div class=\"col-xs-12\">\n                <div class=\"clrweb-DoxMedia\">\n                    <div class=\"clrweb-DoxBookmark hidden-sm-down\">\n                        <div class=\"clrweb-DoxBookmark-bookmark\">\n                            <clr-icon shape=\"bookmark\"></clr-icon>\n                        </div>\n                        <p>Documentation for Badges is available <a routerLink=\"/documentation/badges\">here</a>.</p>\n                    </div>\n                </div>\n            </div>\n        </div>\n\n        <h3 id=\"examples\">Code &amp; Examples</h3>\n        <p>A label is a visual tag that provides additional information about data in the UI.</p>\n\n        <h6 id=\"labels-not-clickable\">1. Labels (not clickable)</h6>\n\n        <clr-labels-default-demo></clr-labels-default-demo>\n\n        <h6 id=\"color-options\">2. Color Options</h6>\n\n        <clr-labels-color-options-demo></clr-labels-color-options-demo>\n\n        <h6 id=\"clickable-labels\">3. Clickable Labels</h6>\n\n        <clr-labels-clickable-demo></clr-labels-clickable-demo>\n\n        <h6 id=\"status-labels-not-clickable\">4. Status Labels (not clickable)</h6>\n\n        <clr-labels-status-demo></clr-labels-status-demo>\n\n        <h6 id=\"labels-with-badges\">5. Labels with Badges</h6>\n\n        <clr-labels-with-badges-demo></clr-labels-with-badges-demo>\n    </article>\n</clr-doc-wrapper>"

