module.exports = "<clr-doc-wrapper [ng]=\"ng\" [ui]=\"ui\" [title]=\"title\" [newLayout]=\"newLayout\">\n    <article>\n        <h5 class=\"component-summary\"\n            id=\"the-login-page-is-a-predefined-form-for-applications-that-require-authentication\">The login page is a\n            predefined form for applications that require authentication.</h5>\n\n        <p>Use Claritys login form by extending the <code class=\"clr-code\">.login</code> classname on <code class=\"clr-code\">form</code> and wrapping it\n            in a container extending the <code class=\"clr-code\">.login-wrapper</code> class.</p>\n\n        <h6 id=\"title-subtitle-and-trademark\">.title, .subtitle and .trademark</h6>\n\n        <p>Extend the <code class=\"clr-code\">.title</code> and <code class=\"clr-code\">.subtitle</code> class on labels indicating the product title and\n            subtitle. If your product title has the trademark symbol, make sure to wrap the trademark symbol in a <code class=\"clr-code\">span</code>\n            with the <code class=\"clr-code\">.trademark</code> class on it.</p>\n\n        <h6 id=\"username\">.username</h6>\n\n        <p>Extend the <code class=\"clr-code\">.username</code> class on the username input field.</p>\n\n        <h6 id=\"password\">.password</h6>\n\n        <p>Extend the <code class=\"clr-code\">.password</code> class on the password input field.</p>\n\n        <h6 id=\"error-active\">.error, .active</h6>\n\n        <p>This wrapper contains a validation message. Extend the <code class=\"clr-code\">.active</code> class with <code class=\"clr-code\">.error</code> to\n            display the validation message.</p>\n\n        <h4 id=\"example\">Example</h4>\n\n        <clr-login-example-demo></clr-login-example-demo>\n\n        <h3 id=\"guidelines\">Usage</h3>\n\n        <p>This component provides a complete login experience.</p>\n\n        <p>To customize the login page, remove the elements you dont need, per your use case. For example, your app may\n            require fewer fields.</p>\n\n        <h4 id=\"validation\">Validation</h4>\n\n        <p>Validation occurs on submit. If the user enters an incorrect user name or password, a validation message\n            appears below the password field.</p>\n\n        <p>For security reasons, Clarity does not call out whether the error occurred in the user name or password\n            field. The validation message text should indicate this situation; for example, The user name or password\n            is incorrect.</p>\n\n        <h4 id=\"responsiveness\">Responsiveness</h4>\n\n        <p>The layout adapts to different screen sizes at 768px and 544px.</p>\n    </article>\n</clr-doc-wrapper>"

