module.exports = "<!--\n  ~ Copyright (c) 2016 - 2017 VMware, Inc. All Rights Reserved.\n  ~ This software is released under MIT license.\n  ~ The full license information can be found in LICENSE in the root directory of this project.\n  -->\n\n<div class=\"clr-example\">\n    <div class=\"backdrop-example-container\">\n        <div *ngIf=\"!basic\" style=\"margin: 0 auto; text-align: center\">\n            <button class=\"btn btn-outline btn-inverse\" (click)=\"basic = true\">Show modal</button>\n        </div>\n        <clr-modal [(clrModalOpen)]=\"basic\" [clrModalStaticBackdrop]=\"true\">\n            <h3 class=\"modal-title\">Add datastore to host</h3>\n            <div class=\"modal-body\">\n                <p>Select a host where you want your datastore to be added.</p>\n\n                <form>\n                    <section class=\"form-block\">\n                        <div class=\"form-group\">\n                            <label for=\"selects_1\">Host</label>\n                            <div class=\"select\">\n                                <select id=\"selects_1\">\n                                    <option>10.11.12.13</option>\n                                    <option>14.15.16.17</option>\n                                    <option>18.19.20.21</option>\n                                    <option>22.23.24.25</option>\n                                </select>\n                            </div>\n                        </div>\n                    </section>\n                </form>\n            </div>\n            <div class=\"modal-footer\">\n                <button class=\"btn btn-outline\" type=\"button\" (click)=\"basic = false\">Cancel</button>\n                <button class=\"btn btn-primary\" type=\"button\" (click)=\"basic = false\">Add</button>\n            </div>\n        </clr-modal>\n    </div>\n</div>\n"

