module.exports = "<clr-doc-wrapper [ng]=\"ng\" [ui]=\"ui\" [title]=\"title\" [newLayout]=\"newLayout\">\n    <article>\n        <h5 class=\"component-summary\"\n            id=\"a-sound-navigation-layout-offers-a-high-degree-of-discoverability-and-feedback-letting-users-know-where-they-are-at-all-times-and-ensuring-they-can-easily-get-to-where-they-want-to-go\">\n            A sound navigation layout offers a high degree of discoverability and feedback, letting users know where\n            they are at all times and ensuring they can easily get to where they want to go.</h5>\n\n        <p>Clarity has three navigation components: header, subnav, and sidenav. Following are the possible combinations\n            of navigation.</p>\n\n        <h6 id=\"header-as-primary-navigation-and-subnav-as-secondary-navigation\">1. Header as primary navigation and\n            subnav as secondary navigation</h6>\n        <clr-layout-no-sidenav-demo></clr-layout-no-sidenav-demo>\n\n        <h6 id=\"header-as-primary-navigation-and-sidenav-as-secondary-navigation\">2. Header as primary navigation and\n            sidenav as secondary navigation</h6>\n        <clr-layout-no-subnav-demo></clr-layout-no-subnav-demo>\n\n        <h6 id=\"header-as-primary-navigation\">3. Header as primary navigation</h6>\n        <clr-layout-only-header-demo></clr-layout-only-header-demo>\n\n        <h6 id=\"sidenav-as-primary-navigation\">4. Sidenav as primary navigation</h6>\n        <clr-layout-only-sidenav-primary></clr-layout-only-sidenav-primary>\n\n        <h6 id=\"subnav-as-primary-navigation-and-sidenav-as-secondary-navigation\">5. Subnav as primary navigation and\n            sidenav as secondary navigation</h6>\n        <clr-layout-only-subnav-primary></clr-layout-only-subnav-primary>\n\n        <p>\n            <a id=\"responsive_navigation\"></a>\n        </p>\n\n        <h3 id=\"responsive-navigation\">Responsive Navigation</h3>\n\n        <p>Clarity provides three levels of navigation represented by the following classnames:</p>\n\n        <ul class=\"list cozy-sm\">\n            <li><code class=\"clr-code\">.header-nav</code> in the application <a routerLink=\"/documentation/header\">header</a>.\n            </li>\n            <li><code class=\"clr-code\">.subnav</code> immediately below the header.</li>\n            <li><code class=\"clr-code\">.sidenav</code> inside the content container. See <a\n                    routerLink=\"/documentation/sidenav\">sidenav</a>.\n            </li>\n        </ul>\n\n        <p>\n            Clarity supports responsive navigation as follows:\n        </p>\n        <ul class=\"list cozy-sm\">\n            <li>\n                Up to two levels of navigation can be made responsive.\n            </li>\n            <li>\n                Responsiveness is triggered below the <code class=\"clr-code\">768px</code> breakpoint by adding the <code\n                    class=\"clr-code\">clr-nav-level</code> input to the navigation level.\n            </li>\n            <li>\n                A <code class=\"clr-code\">clr-nav-level</code> value of <code class=\"clr-code\">1</code> is for primary\n                navigation and <code class=\"clr-code\">2</code> is for secondary navigation.\n            </li>\n            <li>\n                On small screens:\n                <ul class=\"list cozy-sm\">\n                    <li>\n                        The hamburger icon appears on the left of the header and triggers the primary navigation\n                    </li>\n                    <li>\n                        The overflow icon appears on the right and triggers the secondary navigation\n                    </li>\n                </ul>\n            </li>\n        </ul>\n\n        <div class=\"alert alert-info cozy\">\n            <div class=\"alert-item\">\n            <span class=\"alert-text\">\n            Although three levels of navigation make sense on large screens, this number of levels becomes hard to navigate on smaller screens. Clarity recommends that applications for tablets and phones are not exact replicas of the desktop versions, but rather a different, simplified experience.\n        </span>\n            </div>\n        </div>\n\n        <p><strong>Note:</strong> Responsive navigation requires you to use the following Angular components to build\n            the layout of your application:</p>\n\n        <ul class=\"list\">\n            <li><code class=\"clr-code\">clr-main-container</code></li>\n            <li><code class=\"clr-code\">clr-header</code></li>\n        </ul>\n\n        <h4 id=\"examples\">Examples</h4>\n\n        <h6>1. Header navigation as primary and sidenav as secondary</h6>\n        <div class=\"row\">\n            <div class=\"col-xs-12\">\n                <h6>Large screens</h6>\n                <img class=\"img-fluid cozy-sm\"\n                     src=\"assets/images/documentation/navigation/header_sidenav_large.png?1481774401150832000\"/>\n            </div>\n            <div class=\"col-xs-12 col-sm-8 col-md-6\">\n                <h6>Header navigation on small screens</h6>\n                <img class=\"img-fluid cozy-sm\"\n                     src=\"assets/images/documentation/navigation/navLevel1.gif?1481774401150832000\"/>\n            </div>\n            <div class=\"col-xs-12 col-sm-8 col-md-6\">\n                <h6>Sidenav on small screens</h6>\n                <img class=\"img-fluid cozy-sm\"\n                     src=\"assets/images/documentation/navigation/navLevel2.gif?1481774401150832000\"/>\n            </div>\n        </div>\n\n        <clr-responsive-nav-header-sidenav-demo></clr-responsive-nav-header-sidenav-demo>\n\n        <h6>2. Subnav as primary and sidenav as secondary</h6>\n\n        <clr-responsive-nav-subnav-sidenav-demo></clr-responsive-nav-subnav-sidenav-demo>\n\n        <h3 id=\"guidelines\">Designing Navigation</h3>\n\n        <p>When establishing your navigation model, consider:</p>\n\n        <ul class=\"list\">\n            <li>The key use cases of your app</li>\n            <li>The proper hierarchy and what belongs in the primary navigation versus what goes in the secondary or\n                lower levels of navigation\n            </li>\n            <li>Whether to orient the navigation horizontally, vertically, or both</li>\n            <li>Whether responsiveness needs to be part of your platform strategy</li>\n        </ul>\n\n        <!-- ### Navigation Components\n\n      Clarity has three navigation components: header, subnav, and sidenav.  These components:\n\n      {: .list}\n      - Are independent of one another and can be used alone or in combination. This gives you flexibility in designing your navigation schema.\n      - Support a consistent visual hierarchy between levels of navigation.\n      - Adapt to changes in screen size according to predefined breakpoints and grid alignment. This responsiveness helps your app scale from small to large screens.\n      -->\n\n        <h3 id=\"using-the-navigation-patterns\">Using the Navigation Patterns</h3>\n\n        <h4 id=\"header\">Header</h4>\n\n        <div class=\"row\">\n            <div class=\"col-xs-12 col-md-5\">\n                <img src=\"assets/images/documentation/app-layout/Header.png?1481774401150832000\" alt=\"Header\"/>\n            </div>\n            <div class=\"col-xs-12 col-md-7\">\n                <div>The <a routerLink=\"/documentation/header\">header</a> is for primary navigation. Benefits of this\n                    navigation pattern are:\n                </div>\n                <ul class=\"list\">\n                    <li>Users often look for navigation in the header.</li>\n                    <li>Top-level navigation is kept simplethe recommended number of links is 2 to 4.</li>\n                    <li>Navigation does not take real estate away from the content area.</li>\n                </ul>\n                <p>\n                    Conversely, the header supports other items (search and setting) and the navigation links might\n                    become crowded.\n                </p>\n            </div>\n        </div>\n\n        <h4 id=\"subnav\">Subnav</h4>\n\n        <div class=\"row\">\n            <div class=\"col-xs-12 col-md-5\">\n                <img src=\"assets/images/documentation/app-layout/subnav.png?1481774401150832000\" alt=\"Subnav\"/>\n            </div>\n            <div class=\"col-xs-12 col-md-7\">\n                <div>\n                    Use the <a routerLink=\"/documentation/header\">subnav</a> for primary navigation when you need the\n                    sidebar for secondary navigation and any of the following apply:\n                </div>\n                <ul class=\"list\">\n                    <li>You have more links than can fit in the header.</li>\n                    <li>The text of your links is too long for the header.</li>\n                    <li>You want to limit the header to search and settings.</li>\n                </ul>\n            </div>\n        </div>\n\n        <h4 id=\"sidenav\">Sidenav</h4>\n\n        <div class=\"row\">\n            <div class=\"col-xs-12 col-md-5\">\n                <img src=\"assets/images/documentation/app-layout/sidenav.png?1481774401150832000\" alt=\"Sidenav\"/>\n            </div>\n            <div class=\"col-xs-12 col-md-7\">\n                <div>\n                    Benefits of the <a routerLink=\"/documentation/sidenav\">sidenav</a> are that it:\n                </div>\n                <ul class=\"list\">\n                    <li>Is a familiar navigation pattern for users.</li>\n                    <li>Accommodates a large number of links, becoming vertically scrollable when content exceeds the\n                        view port.\n                    </li>\n                    <li>Supports progressive disclosure of a hierarchy.</li>\n                    <li>Supports categorization of links.</li>\n                </ul>\n                <p>\n                    Conversely, the sidenav takes real estate away from the content area. Also, on mobile, the hierarchy\n                    within the sidenav should be kept to a minimum.\n                </p>\n            </div>\n        </div>\n\n        <h3 id=\"combining-navigation-patterns\">Combining Navigation Patterns</h3>\n\n        <h4>Header and sidenav</h4>\n        <div class=\"row cozy-sm\">\n            <div class=\"col-xs-12 col-md-5\">\n                <img src=\"assets/images/documentation/app-layout/header_sidenav.png?1481774401150832000\"\n                     alt=\"Header &amp; Sidenav\"/>\n            </div>\n            <div class=\"col-xs-12 col-md-7\">\n                <div>\n                    A common pattern for two levels of navigation. The primary navigation is in the header, secondary in\n                    the sidenav.\n                </div>\n            </div>\n        </div>\n\n        <h4>Header and subnav</h4>\n        <div class=\"row cozy-sm\">\n            <div class=\"col-xs-12 col-md-5\">\n                <img src=\"assets/images/documentation/app-layout/header_subnav.png?1481774401150832000\"\n                     alt=\"Header &amp; Subnav\"/>\n            </div>\n            <div class=\"col-xs-12 col-md-7\">\n                <div>\n                    Because both patterns are horizontal, use this combination only when the secondary navigation does\n                    not warrant the space taken up by the sidenav.\n                </div>\n            </div>\n        </div>\n\n        <h4>Subnav and sidenav</h4>\n        <div class=\"row cozy-sm\">\n            <div class=\"col-xs-12 col-md-5\">\n                <img src=\"assets/images/documentation/app-layout/subnav_sidenav.png?1481774401150832000\"\n                     alt=\"Subnav &amp; Sidenav\"/>\n            </div>\n            <div class=\"col-xs-12 col-md-7\">\n                <div>\n                    Use the subnav for primary navigation when the links do not fit in the header.\n                </div>\n            </div>\n        </div>\n\n        <h4>Header, subnav and sidenav</h4>\n        <div class=\"row cozy-sm\">\n            <div class=\"col-xs-12 col-md-5\">\n                <img src=\"assets/images/documentation/app-layout/header_subnav_sidenav.png?1481774401150832000\"\n                     alt=\"Header, Subnav &amp; Sidenav\"/>\n            </div>\n            <div class=\"col-xs-12 col-md-7\">\n                <div>\n                    This schema will not result in a clear visual hierarchy because of the adjacent horizontal patterns.\n                    An alternative is to use the header and sidenav and then provide further navigation in the content\n                    area by using tabs.\n                </div>\n            </div>\n        </div>\n\n        <h3 class=\"cozy\" id=\"navigation_layouts\">Responsive Navigation Layouts</h3>\n\n        <p>Responsiveness is supported for the primary and secondary levels of navigation. If your app has more than two\n            levels of navigation, youll need to build a custom solution. At three levels, the navigation becomes\n            increasingly nested and too complex\n            for Clarity to provide a single responsive solution.</p>\n\n        <p>For layouts 768px or under:</p>\n\n        <ul class=\"list\">\n            <li>Primary navigation targets move to a hamburger menu on the left.</li>\n            <li>Secondary navigation targets move to an overflow menu on the right.</li>\n        </ul>\n\n        <div class=\"row cozy-sm\">\n            <div class=\"col-xs-12\">\n                <img src=\"assets/images/documentation/app-layout/header_small.png?1481774401150832000\" class=\"img-fluid\"\n                     alt=\"Header on Small Screens\"/>\n            </div>\n        </div>\n\n        <p>When the user clicks the menu icon, a temporary side panel opens with the navigation targets. Content is not\n            accessible while the panel is open.</p>\n\n        <div class=\"row\">\n            <div class=\"col-xs-12 col-sm-12 col-md-6 cozy-sm\">\n                <img src=\"assets/images/documentation/app-layout/header_nav_level_2.png?1481774401150832000\"\n                     class=\"img-fluid\" alt=\"Header Triggers Pressed\"/>\n            </div>\n            <div class=\"col-xs-12 col-sm-12 col-md-6 cozy-sm\">\n                <img src=\"assets/images/documentation/app-layout/header_nav_level_1.png?1481774401150832000\"\n                     class=\"img-fluid\" alt=\"Header Triggers Pressed\"/>\n            </div>\n        </div>\n    </article>\n\n</clr-doc-wrapper>"

