module.exports = "<clr-doc-wrapper [ng]=\"ng\" [ui]=\"ui\" [title]=\"title\" [newLayout]=\"newLayout\">\n    <article>\n        <h5 class=\"component-summary\"\n            id=\"with-a-select-box-users-can-select-one-item-from-a-list-of-values-the-selected-item-is-visible-when-the-select-box-is-closed\">\n            With a select box, users can select one item from a list of values. The selected item is visible when the\n            select box is closed.</h5>\n\n        <p>Select boxes are a <code class=\"clr-code\">select</code> element with its <code class=\"clr-code\">option</code>s\n            wrapped in a block element with the <code class=\"clr-code\">.select</code> classname applied to it. To use a\n            select box within a form, it\n            can be wrapped in another block element with the <code class=\"clr-code\">.form-group</code> classname.</p>\n\n        <clr-select-types-demo></clr-select-types-demo>\n\n        <h3 id=\"guidelines\">Usage</h3>\n\n        <p>Use a select box for a list of items that a user does not need to see all the time.</p>\n\n        <p>A common strategy is to combine an input field with a select box so that a user can enter a value and qualify\n            it with a menu item. For example, the user might enter a number in an input field and select the units from\n            the select box.</p>\n\n        <p>Dont confuse a select box with a <a routerLink=\"/documentation/dropdowns\">dropdown menu</a>. Select boxes\n            are for setting options and work best in forms. Dropdowns are for presenting actions and most appropriate in\n            a header.</p>\n\n        <h4 id=\"number-of-list-items\">Number of List Items</h4>\n\n        <p>Typically, a select box contains between 3 and 12 items. For fewer than 3 items or to present choices that\n            are always visible, consider a <a routerLink=\"/documentation/radios\">radio button</a>.</p>\n\n        <h4 id=\"label\">Label</h4>\n\n        <p>A select box requires a brief introductory label that describes the items in the menu. Use sentence-style\n            capitalization for both the label and the menu items.</p>\n    </article>\n</clr-doc-wrapper>"

