module.exports = "<clr-doc-wrapper [ng]=\"ng\" [ui]=\"ui\" [title]=\"title\" [newLayout]=\"newLayout\">\n    <article>\n        <h5 class=\"component-summary\" id=\"a-spinner-is-visual-indicator-of-an-ongoing-user-initiated-process\">A spinner\n            is visual indicator of an ongoing, user-initiated process.</h5>\n\n        <p>Clarity has two types of spinners:</p>\n\n        <ul class=\"list\">\n            <li><strong>Page Spinners:</strong> For tracking the progress of an operation related to an entire page.\n            </li>\n            <li><strong>Inline Spinners:</strong> For tracking the progress of an operation related to a specific\n                component.\n            </li>\n        </ul>\n\n        <h6 id=\"spinner\">.spinner</h6>\n\n        <p>Use the <code class=\"clr-code\">.spinner</code> to create a page spinner.</p>\n\n        <h6 id=\"spinner-inline\">.spinner-inline</h6>\n\n        <p>Extend the <code class=\"clr-code\">.spinner-inline</code> class with <code class=\"clr-code\">.spinner</code> to\n            create an inline spinner.</p>\n\n        <h6 id=\"spinner-inverse\">.spinner-inverse</h6>\n\n        <p>Extend the <code class=\"clr-code\">.spinner-inverse</code> class with <code class=\"clr-code\">.spinner</code>\n            to create a spinner for dark\n            backgrounds.</p>\n\n        <h3 id=\"examples\">Examples</h3>\n\n        <clr-spinner-types></clr-spinner-types>\n\n        <h3 id=\"spinner-sizes\">Spinner Sizes</h3>\n\n        <p>Clarity spinners can be displayed in three sizes:</p>\n\n        <ul class=\"list\">\n            <li><strong>Small:</strong> This is the required sizing for inline spinners (see above). It measures 18x18\n                pixels.\n            </li>\n            <li><strong>Medium:</strong> Medium spinners measure 36x36 pixels.</li>\n            <li><strong>Large:</strong> This is the default size for page spinners (see above).</li>\n        </ul>\n\n        <h6 id=\"spinner-sizes-classnames\">Spinner sizes classnames</h6>\n\n        <p>The classnames used to size spinners are: <code class=\"clr-code\">.spinner-sm</code>, <code class=\"clr-code\">.spinner-md</code>,\n            and <code class=\"clr-code\">.spinner-lg</code>. Note that using the <code\n                    class=\"clr-code\">.spinner-inline</code> class\n            will force a spinner to the small size and that <code class=\"clr-code\">.spinner-lg</code> is the default\n            sizing of page spinners.</p>\n\n        <h3 id=\"examples-1\">Examples</h3>\n\n        <clr-spinner-sizes></clr-spinner-sizes>\n\n        <h3 id=\"guidelines\">Usage</h3>\n\n        <p>Use the three sizes of spinners as follows:</p>\n\n        <table class=\"table\">\n            <tbody>\n            <tr>\n                <td class=\"left\">\n                    <b>Large</b>\n                    <div class=\"hidden-sm-up nowrap\">72px &times; 72px</div>\n                </td>\n                <td class=\"left hidden-xs-down nowrap\">72px &times; 72px</td>\n                <td class=\"left\">\n                    Use to track the progress of an operation related to a page. For example, in the login form, a large\n                    spinner replaces the form fields while the data is being authenticated.\n                </td>\n            </tr>\n            <tr>\n                <td class=\"left\">\n                    <b>Medium</b>\n                    <div class=\"hidden-sm-up nowrap\">36px &times; 36px</div>\n                </td>\n                <td class=\"left hidden-xs-down nowrap\">36px &times; 36px</td>\n                <td class=\"left\">Use when content is being loaded, for example, in a table or datagrid.</td>\n            </tr>\n            <tr>\n                <td class=\"left\">\n                    <b>Small</b>\n                    <div class=\"hidden-sm-up\">18px &times; 18px</div>\n                </td>\n                <td class=\"left hidden-xs-down\">18px &times; 18px</td>\n                <td class=\"left\">Use in constrained spaces, such as in an input field or next to a button. The spinner\n                    animates and the field or button is disabled until the action is complete.\n                </td>\n            </tr>\n            </tbody>\n        </table>\n\n        <h4 id=\"placement\">Placement</h4>\n\n        <p>Place the spinner where you want to focus users attention when the process completes.</p>\n\n        <h4 id=\"label\">Label</h4>\n\n        <p>Optionally, provide a brief description of the process, for example, Loading </p>\n\n        <h4 id=\"spinners-versus-progress-bars\">Spinners Versus Progress Bars</h4>\n\n        <p>Clarity provides a linear, indeterminate <a routerLink=\"/documentation/progress\">progress bar</a> that serves\n            the same use cases as a spinner. Using a spinner or an indeterminate progress bar is a matter of spacing,\n            visual consistency, and the object\n            the user selected to begin the process.</p>\n    </article>\n</clr-doc-wrapper>"

