module.exports = "<clr-doc-wrapper [ng]=\"ng\" [ui]=\"ui\" [title]=\"title\" [newLayout]=\"newLayout\">\n    <article>\n        <h5 class=\"component-summary\"\n            id=\"a-stack-view-displays-keyvalue-pairs-which-users-can-expand-to-show-more-detail\">A stack view displays\n            key/value pairs, which users can expand to show more detail.</h5>\n\n        <h3 id=\"html-and-styles\">HTML and Styles</h3>\n\n        <div class=\"alert alert-warning\">\n            <div class=\"alert-item\">\n            <span class=\"alert-text\">\n            We do not recommend using Stack View as a static component since the DOM structure\n            is architected to enable the Stack View's Javascript behavior and animation handling.\n            If you cannot use the Angular component, these are the elements and\n            classes you will need to use to benefit from Clarity's styles, without the animations.\n        </span>\n            </div>\n        </div>\n\n        <clr-stack-view-static-demo class=\"clrweb-stackview-demo\"></clr-stack-view-static-demo>\n\n        <h3 id=\"basic-stack-view-component\">Basic Stack View Component</h3>\n\n        <clr-stack-view-angular-basic-demo class=\"clrweb-stackview-demo\"></clr-stack-view-angular-basic-demo>\n\n        <h3 id=\"stack-view-with-editing-in-a-modal\">Stack View With Editing in a Modal</h3>\n\n        <clr-stack-view-angular-modal-edit-demo class=\"clrweb-stackview-demo\"></clr-stack-view-angular-modal-edit-demo>\n\n        <h3 id=\"lazy-loading-of-children\">Lazy Loading of Children</h3>\n\n        <p>This example shows how to leverage the various inputs and outputs provided by\n            <code class=\"clr-code\">&lt;clr-stack-block&gt;</code> to make blocks expandable even though their children\n            are loaded on demand from the server.</p>\n\n        <clr-stack-view-angular-lazyload-demo class=\"clrweb-stackview-demo\"></clr-stack-view-angular-lazyload-demo>\n\n        <h6 id=\"options-for-ltclr-stack-blockgt\">Options for &lt;clr-stack-block&gt;</h6>\n\n        <table class=\"table\">\n            <thead>\n            <tr>\n                <th class=\"left\">Input/Output</th>\n                <th class=\"hidden-xs-down\">Values</th>\n                <th class=\"left hidden-xs-down\">Default</th>\n                <th class=\"left\">Effect</th>\n            </tr>\n            </thead>\n            <tbody>\n            <tr>\n                <td class=\"left\">\n                    <b>[clrSbExpandable]</b>\n                    <div class=\"hidden-sm-up\">Type: Boolean</div>\n                    <div class=\"hidden-sm-up\">\n                        Default:<br/> true if <code class=\"clr-code\">&lt;clr-stack-block&gt;</code> children are\n                        detected\n                    </div>\n                </td>\n                <td class=\"hidden-xs-down\">true, false</td>\n                <td class=\"left hidden-xs-down\">\n                    true if and only if\n                    <code class=\"clr-code\">&lt;clr-stack-block&gt;</code> children are detected\n                </td>\n                <td class=\"left\">\n                    Makes the stack block expandable, even if it doesnt contain any nested\n                    <code class=\"clr-code\">&lt;clr-stack-block&gt;</code>\n                </td>\n            </tr>\n            <tr>\n                <td class=\"left\">\n                    <b>[clrSbExpanded]</b>\n                    <div class=\"hidden-sm-up\">Type: Boolean</div>\n                    <div class=\"hidden-sm-up\">Default: false</div>\n                </td>\n                <td class=\"hidden-xs-down\">true, false</td>\n                <td class=\"left hidden-xs-down\">false</td>\n                <td class=\"left\">\n                    Two-way binding on the state of the block: expanded or collapsed. Has no effect if the block is not\n                    expandable.\n                </td>\n            </tr>\n            <tr>\n                <td class=\"left\">\n                    <b>[clrSbNotifyChange]</b>\n                    <div class=\"hidden-sm-up\">Type: Boolean</div>\n                    <div class=\"hidden-sm-up\">Default: false</div>\n                </td>\n                <td class=\"hidden-xs-down\">true, false</td>\n                <td class=\"left hidden-xs-down\">false</td>\n                <td class=\"left\">\n                    Shows an updated indicator on the stack block, when set to true.\n                </td>\n            </tr>\n            </tbody>\n        </table>\n\n        <h3 id=\"guidelines\">Usage</h3>\n\n        <p>Stack views are designed for use in the main content area and modals. Use a stack view when you want to:</p>\n\n        <ul class=\"list\">\n            <li>Display related key/value pairs, for example, an objects settings.</li>\n            <li>Progressively disclose data. This is useful when the set of key/value pairs is large or you want to\n                enable users to reveal more complex or less frequently used data as necessary.\n            </li>\n        </ul>\n\n        <h4 id=\"enabling-value-editing\">Enabling Value Editing</h4>\n\n        <p>In this pattern, the component includes an Edit button on the top right, which on click opens an editable\n            stack view in a modal. This design prevents users from accidentally altering a value in the main content\n            area. Common editing controls include\n            input fields, select boxes, checkboxes, and radio buttons.</p>\n\n        <h4 id=\"labels\">Labels</h4>\n\n        <ul class=\"list\">\n            <li>Provide terse labels that let users know what is under the label. Try to keep the label to one line.\n            </li>\n            <li>Use noun phrases, sentence-style capitalization, and no ending punctuation.</li>\n            <li>Avoid using icons.</li>\n        </ul>\n\n        <h4 id=\"highlights-and-horizontal-lines\">Highlights and Horizontal lines</h4>\n\n        <p>The stack view highlight color (#DDDDDD) differs from the usual Clarity highlight color to make it more\n            distinct. Expanded sections have a lighter background color to make it easier to parse the hierarchy.</p>\n\n        <p>Horizontal lines in the stack editor are for readabilitythey help users quickly discern the relationship\n            between columns.</p>\n    </article>\n</clr-doc-wrapper>"

